import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const al = () => {
  alert('확인');
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div>
    <App onClick={al}/>
    <button onDoubleClick={al} className="check">확인</button>
  </div>
);
